import React from 'react';
import './topbar.css';
import '../bootstrap.min.css';

export default function TopBar() {
  return (
    <div className='top'>
            <div className="row">
                <div className="col-md-4" style="color: white; padding-left: 10px;">
                    <h2>&nbsp;Pragmata</h2>
                </div>
                <div className="col-md-4" style="text-align: center;">
                    <img src="img/ukraine.png" style="width: 30px;" alt=""/>
                    <br />
                    <img src="img/freeukraine.png" style="width: 110px" alt="" />
                </div>
                <div className="col-md-4" style="color: white; text-align: right;" >
                    <h2>πράγματα</h2>
               </div>
            </div>
        </div>
  )
}
